BEGIN TRANSACTION;
CREATE TABLE "walkable_paths" (
	`building`	TEXT,
	`floor`	INTEGER,
	`x_coordinate`	INTEGER,
	`y_coordinate`	INTEGER
);
CREATE TABLE "room" (
	`_id`	INTEGER,
	`name`	TEXT,
	`center_coordinate`	INTEGER,
	`indoorMapTile`	TEXT,
	`room_number`	TEXT,
	`building`	TEXT,
	`floor_number`	INTEGER,
	`polygon_coordinates`	TEXT,
	`room_icon`	TEXT,
	PRIMARY KEY(`_id`)
);
CREATE TABLE `indoor_maps` (
	`building`	TEXT,
	`floor`	INTEGER,
	`map_height`	INTEGER,
	`map_width`	INTEGER
);
CREATE TABLE `connected_poi_links` (
	`connectedPoiId`	INTEGER,
	`indoorPoiId`	INTEGER
);
CREATE TABLE "connected_poi" (
	`_id`	INTEGER,
	`name`	TEXT,
	`building`	TEXT,
	`floor_number`	INTEGER,
	`discriminator`	TEXT,
	PRIMARY KEY(`_id`)
);
CREATE TABLE building(
 _id INTEGER PRIMARY KEY, 
 name TEXT,
 short_name TEXT, 
 center_coordinate TEXT, 
 edge_coordinates TEXT,
 resource_image_id TEXT,
 is_small_building INTEGER
, campus TEXT);
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE shuttle (
	`sgw_loy_moth`	TEXT,
	`sgw_loy_fri`	TEXT,
    `loy_sgw_moth`  TEXT,
    `loy_sgw_fri`   TEXT
);
COMMIT;